import { PropsWithChildren } from "react";
import { WorkExperience } from "./ResumeItems";

function formatDate(start: Date, end?: Date): string {
    const startDate = (start.getMonth() + 1).toString() + + start.getFullYear().toString()
    let endDate = 'Present'
    if(end) {
        endDate = end.getMonth().toString().concat('/', end.getFullYear().toString())
    }
    return startDate.concat(' - ', endDate)
}

export function GridItem({children}: PropsWithChildren<{}>) {
    return (<div className=''>{children}</div>)
}

export function Title({children}: PropsWithChildren<{}>) {
    return (<h2 className='font-semibold text-left px-5'>{children}</h2>)
}

export function SecondaryItem({children}: PropsWithChildren<{}>) {
    return (<h2 className='font-normal text-right px-5'>{children}</h2>)
}

export function WorkExperienceItem({workExp}:{workExp: WorkExperience}): JSX.Element {
    return (<div className='grid grid-cols-2 bg-stone-800 text-slate-50'>
        <Title>{workExp.name}</Title>
        <SecondaryItem>{workExp.location}</SecondaryItem>
        <SecondaryItem>{formatDate(workExp.startDate, workExp.endDate)}</SecondaryItem>
    </div>)
}
